== Schloßpark Ahrensburg ==
Der '''Schlosspark Ahrensburg''' ist ein Park in Ahrensburg. Er liegt im Norden des Stadtzentrums und ist Teil des Schlosses Ahrensburg. Der Park ist 72.000 m² groß und wurde 1585 von Peter Rantzau angelegt. Der Park ist ein beliebtes Ausflugsziel und wird von vielen Ahrensburgern und Touristen besucht. == Geschichte == Der Schlosspark Ahrensburg wurde 1585 von Peter Rantzau angelegt. Der Park wurde im 18. Jahrhundert im Stil eines Barockgartens umgestaltet. Im 19. Jahrhundert wurde der Park im Stil eines englischen Landschaftsgartens umgestaltet, der bis heute erhalten ist.

